import { Link } from 'react-router-dom';
import Insta from '../Assets/Images/icon-instagram.svg';
import Face from '../Assets/Images/icon-facebook.svg';
import Linked from '../Assets/Images/icon-linkedin.svg';

const Footer = () => {
    return (
        <footer className="w-full h-36 relative bg-gradient-to-br from-black via-black to-green-400">
            <div className="flex items-start gap-6">
                <Link to="https://www.instagram.com" target="_blank">
                    <img className="logo-insta w-8 h-8 bg-green" src={Insta} alt="instagram" />
                </Link>

                <Link to="https://www.facebook.com" target="_blank">
                    <img className="logo-face w-8 h-8" src={Face} alt="facebook" />
                </Link>

                <Link to="https://www.linkedin.com" target="_blank">
                    <img className="logo-linked w-8 h-8" src={Linked} alt="linkedin" />
                </Link>
            </div>

            <div className="copyright absolute left-1/3 top-2/3 text-white font-bold text-xl">
                Â© count-of-money 2023. All Rights Reserved.
            </div>
        </footer>
    );
};

export default Footer;
